var title_f36_42_37549="TNM stage hypopharynx";
var content_f36_42_37549=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F55865&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F55865&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Tumor node metastases (TNM) staging system for cancer of the hypopharynx",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\" colspan=\"4\">",
"       Primary tumor (T)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       TX",
"      </td>",
"      <td colspan=\"3\">",
"       Primary tumor cannot be assessed",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       T0",
"      </td>",
"      <td colspan=\"3\">",
"       No evidence of primary tumor",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Tis",
"      </td>",
"      <td colspan=\"3\">",
"       Carcinoma in situ",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       T1",
"      </td>",
"      <td colspan=\"3\">",
"       Tumor limited to one subsite of hypopharynx and/or 2 cm or less in greatest dimension",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       T2",
"      </td>",
"      <td colspan=\"3\">",
"       Tumor invades more than one subsite of hypopharynx or an adjacent site, or measures more than 2 cm but not more than 4 cm in greatest dimension without fixation of hemilarynx",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       T3",
"      </td>",
"      <td colspan=\"3\">",
"       Tumor more than 4 cm in greatest dimension or with fixation of hemilarynx or extension to esophagus",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"2\">",
"       T4a",
"      </td>",
"      <td colspan=\"3\">",
"       Moderately advanced local disease",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"3\">",
"       Tumor invades thyroid/cricoid cartilage, hyoid bone, thyroid gland, or central compartment soft tissue*",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"2\">",
"       T4b",
"      </td>",
"      <td colspan=\"3\">",
"       Very advanced local disease",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"3\">",
"       Tumor invades prevertebral fascia, encases carotid artery, or involves mediastinal structures",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\" colspan=\"4\">",
"       Regional lymph nodes (N)&bull;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       NX",
"      </td>",
"      <td colspan=\"3\">",
"       Regional lymph nodes cannot be assessed",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       N0",
"      </td>",
"      <td colspan=\"3\">",
"       No regional lymph node metastasis",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       N1",
"      </td>",
"      <td colspan=\"3\">",
"       Metastasis in a single ipsilateral lymph node, 3 cm or less in greatest dimension",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1_start\">",
"       N2",
"      </td>",
"      <td class=\"sublist_other_start\" colspan=\"3\">",
"       Metastasis in a single ipsilateral lymph node, more than 3 cm but not more than 6 cm in greatest dimension, or in multiple ipsilateral lymph nodes, none more than 6 cm in greatest dimension, or in bilateral or contralateral lymph nodes, none more than 6 cm in greatest dimension",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       N2a",
"      </td>",
"      <td class=\"sublist_other\" colspan=\"3\">",
"       Metastasis in a single ipsilateral lymph node more than 3 cm but not more than 6 cm in greatest dimension",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       N2b",
"      </td>",
"      <td class=\"sublist_other\" colspan=\"3\">",
"       Metastasis in multiple ipsilateral lymph nodes, none more than 6 cm in greatest dimension",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       N2c",
"      </td>",
"      <td class=\"sublist_other\" colspan=\"3\">",
"       Metastasis in bilateral or contralateral lymph nodes, none more than 6 cm in greatest dimension",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       N3",
"      </td>",
"      <td colspan=\"3\">",
"       Metastasis in a lymph node more than 6 cm in greatest dimension",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\" colspan=\"4\">",
"       Distant metastasis (M)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       M0",
"      </td>",
"      <td colspan=\"3\">",
"       No distant metastasis",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       M1",
"      </td>",
"      <td colspan=\"3\">",
"       Distant metastasis",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\" colspan=\"4\">",
"       Anatomic stage/prognostic groups",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Stage 0",
"      </td>",
"      <td>",
"       Tis",
"      </td>",
"      <td>",
"       N0",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Stage I",
"      </td>",
"      <td>",
"       T1",
"      </td>",
"      <td>",
"       N0",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Stage II",
"      </td>",
"      <td>",
"       T2",
"      </td>",
"      <td>",
"       N0",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"4\">",
"       Stage III",
"      </td>",
"      <td>",
"       T3",
"      </td>",
"      <td>",
"       N0",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       T1",
"      </td>",
"      <td>",
"       N1",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       T2",
"      </td>",
"      <td>",
"       N1",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       T3",
"      </td>",
"      <td>",
"       N1",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"6\">",
"       Stage IVA",
"      </td>",
"      <td>",
"       T4a",
"      </td>",
"      <td>",
"       N0",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       T4a",
"      </td>",
"      <td>",
"       N1",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       T1",
"      </td>",
"      <td>",
"       N2",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       T2",
"      </td>",
"      <td>",
"       N2",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       T3",
"      </td>",
"      <td>",
"       N2",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       T4a",
"      </td>",
"      <td>",
"       N2",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"2\">",
"       Stage IVB",
"      </td>",
"      <td>",
"       T4b",
"      </td>",
"      <td>",
"       Any N",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Any T",
"      </td>",
"      <td>",
"       N3",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Stage IVC",
"      </td>",
"      <td>",
"       Any T",
"      </td>",
"      <td>",
"       Any N",
"      </td>",
"      <td>",
"       M1",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Note: cTNM is the clinical classification, pTNM is the pathologic classification.",
"    <div class=\"footnotes\">",
"     * Central compartment soft tissue includes prelaryngeal strap muscles and subcutaneous fat.",
"     <br>",
"      &bull; Metastases at level VII are considered regional lymph node metastases.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Used with the permission of the American Joint Committee on Cancer (AJCC), Chicago, Illinois. The original source for this material is the AJCC Cancer Staging Manual, Seventh Edition (2010) published by Springer New York, Inc.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
