var title_f36_42_37550="Bone markers and bone loss";
var content_f36_42_37550=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ENDO%2F71125&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ENDO%2F71125&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 518px\">",
"   <div class=\"ttl\">",
"    High bone turnover is predictive of rapid bone loss",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 498px; height: 353px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The probability of rapid loss was calculated from the corresponding logistic regression equation for each marker. At each level, from left to right, the markers were: BAP (red bars), OC (blue bars), DPD (green bars), and PYD (orange bars). The means and SDs were based on all 199 samples.",
"    <div class=\"footnotes\">",
"     BAP: bone specific alkaline phosphatase; OC: osteocalcin; DPD: free deoxypyridinoline; PYD: free pyridinolines.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Ross, PD, Knowlton, W. Rapid bone loss is associated with increased levels of biochemical markers. J Bone Miner Res 1998; 13:297. Copyright &copy;1998 American Society for Bone and Mineral Research.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
